extern "C" fn init_lse() {
        use crate::arch;

        // This is provided by compiler-builtins::aarch64_linux.
        unsafe extern "C" {
            fn __rust_enable_lse();
        }

        if arch::is_aarch64_feature_detected!("lse") {
            unsafe {
                __rust_enable_lse();
            }
        }
    }
